package lista6_aula2;



public class exer2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		double f = 50;
		double g = 0;
		double i = 50;
		System.out.println ("Conversão de Fahrenheit para Celsius ");
		while (i <=150) {
			System.out.println ("" +5*(f-32)/9+"");
			g = f;
			f++;
			i++;
			System.out.println(g);
				
		}
	
			
		}
	}
